import React from "react";
import { Redirect, Route } from "react-router-dom";
import userInfo from "./App"


export const PrivateRoute = ({component: Component, ...rest}) => {
	return (
		<Route {...rest} render={
			(props) => {
				if (userInfo !== null) {
					return <Component {...props} />
				} else {
					return <Redirect to={
						{
							pathname: "/login",
							state: {
								from: props.location
							}
						}
					} />
				}
			}
		}/>
	)
}
